import React from 'react';
import {ReactComponent as Close} from '../../../assets/img/close.svg'

function Repo({repo, removeRepo, setReleaseNotes, key}) {
    console.log(this.props)
    return (
        <div
            className="repo"
        >
            <div
                className="title cursor"
                onClick={() => setReleaseNotes(key)}
            >
                {repo.data.name}
            </div>
            <div className="flex align-items-center">
                <div className="new">
                    New Release!
                </div>
                {repo.notes &&
                    <div className="version">
                        {repo.notes?.name}
                    </div>
                }
                <Close
                    className="close cursor"
                    onClick={removeRepo}
                />
            </div>
        </div>
    );
}

export default Repo;
